[{"location":"fct_index/#Index-des-fonctions","page":"Index des fonctions","title":"Index des fonctions","text":"","category":"section"},{"location":"fct_index/","page":"Index des fonctions","title":"Index des fonctions","text":"Documentation de toute les fonctions du package EDO","category":"page"},{"location":"fct_index/","page":"Index des fonctions","title":"Index des fonctions","text":"Pages = [\"fct_index.md\"]","category":"page"},{"location":"fct_index/","page":"Index des fonctions","title":"Index des fonctions","text":"Modules = [EDO]\nOrder   = [:function, :type]","category":"page"},{"location":"fct_index/#EDO.d_fun_vdp-Tuple{Any,Any}","page":"Index des fonctions","title":"EDO.d_fun_vdp","text":"dérivée du deuxieme membre de l'equation differentiel de l'equation de Van der Pol\n\nInputs\n\nt = l'instant t  \ny = la valeur de y à cet instant\n\nOutputs\n\ndypoint = leftbeginarraycc 0  1  -2 y_1(t)y_2(t)-1  1-y_1(t)^2 endarray right\n\n\n\n","category":"method"},{"location":"fct_index/#EDO.fun_vdp-Tuple{Any,Any}","page":"Index des fonctions","title":"EDO.fun_vdp","text":"Deuxieme membre de l'equation differentiel de l'equation de Van der Pol\n\nInputs\n\nt = l'instant t  \ny = la valeur de y à cet instant\n\nOutputs\n\nypoint = left beginalignedbeginarrayc doty_1(t)= y_2(t)  doty_2(t)= (1-y_1^2(t)) y_2(t)-y_1(t) endarray endalignedright \n\n\n\n","category":"method"},{"location":"fct_index/#EDO.ode_euler-Tuple{Function,Any,Any,Any}","page":"Index des fonctions","title":"EDO.ode_euler","text":"Explicit Euler method \n\nDescription\n\n    Numerical integration of the Cauchy's problem\n    x_point(t) = phi(t,x(t))\n    x(t_0) = x_0\n\nUsage\n\n- T, X = ode_euler(phi,t0tf,y0,N)\n\nInputs\n\nf    - function     : second member of the ode whith the interface \n                      xpoint = phi(t, x)\n                          t    - real     : time,\n                          x = vector of R^n with the same dimension of x0\nt0tf - real(2)      : intial and final time  [t0,tf]\nx0   - real(n)      : initial point\nN    - integer      : number of steps (>1)\n\nOutputs\n\nT    - real(N+1,1)  : vector of times\nX    - real(N+1,n)  : Matrix of solution, The line i of [T Y] contains ti and x_i\n\n\n\n\n\n","category":"method"},{"location":"fct_index/#EDO.ode_euler_pasfixe-Tuple{Function,Any,Any,Any}","page":"Index des fonctions","title":"EDO.ode_euler_pasfixe","text":"Programme d'integration par le schema d'Euler à pas constant\n\nUsage\n\n- T,Y,nphie,ifail=ode_euler_pasfixe(phi,t0tf,y0,N)\n\nInput parameters\n\n- phi = second member ypoint=phi[t,y]\n- t0tf = [t0,tf]\n- y0 = initial point\n- N = number of step\n\nOutput parameters\n\n- T = vector of time\n- Y = Matrix of solution, The line i of [T Y] contains ti & y[ti]\n\n\n\n\n\n","category":"method"},{"location":"fct_index/#EDO.ode_gauss-Tuple{Function,Any,Any,Any}","page":"Index des fonctions","title":"EDO.ode_gauss","text":"Numerical integration by Gauss method of order 4\n\nUsage\n\n- T,Y,nphie,ifail=ode_gauss(phi,t0tf,y0,options)\n\nInput parameters\n\n- phi = second member ypoint=phi[t,y]\n- t0tf = [t0,tf]\n- y0 = initial point\n- options[1] = N = number of step\n- options[2] = fpitermax = maximum number of iterations for the fixed point\n- options[3] = fpeps = epsilon for the test of progress in the fixed point\n\nOutput parameters\n\n- T = vector of time\n- Y = Matrix of solution The line i of [T Y] contains ti & y[ti]\n- ifail[i] = 1 = computation successful for the fixed point on [t_i,t_[i+1]] \n- ifail[i] = -1 = computation failed for the fixed point on [t_i,t_[i+1]]: maximum number of iteration is attained in the fixed point\n- nphie = number of evaluation of phi\n\n\n\n\n\n","category":"method"},{"location":"fct_index/#EDO.ode_gauss_newton-Tuple{Function,Function,Any,Any,Any}","page":"Index des fonctions","title":"EDO.ode_gauss_newton","text":"Numerical integration by Gauss method of order 4,The solution on the non linear equation is computed by Newton method\n\nUsage\n\n- T,Y,nphie,ndphie,ifail=ode_gauss_newton(phi,dphi,t0tf,y0,options)\n\nInput parameters\n\n- phi = second member ypoint=phi(t,y)\n- t0tf = [t0,tf]\n- y0 = initial point\n- options[1] = N = number of step\n- options[2] = fpitermax = maximum number of iterations for the fixed point\n- options[3] = fpeps = epsilon for the test of progress in the fixed point\n\nOutput parameters\n\n- T = vector of times\n- Y = Matrix of solution, The line i of [T Y] contains ti and y(ti)\n- ifail[i] = 1 = computation successful for the fixed point on [t_i,t_{i+1}] \n- ifail[i] = -1 = computation failed for the fixed point on [t_i,t_{i+1}]: maximum number of iteration is attained in the fixed point\n- nphie = number of evaluation of phi\n\n\n\n\n\n","category":"method"},{"location":"fct_index/#EDO.ode_gauss_pf-Tuple{Function,Any,Any,Any}","page":"Index des fonctions","title":"EDO.ode_gauss_pf","text":"Numerical integration by Gauss method of order 4\n\nUsage\n\n- [T,Y,nphie,ifail,KK]=ode_gauss_pf(phi,t0tf,y0,options)\n\nInput parameters\n\n- phi = second member ypoint=phi(t,y)\n- t0tf = [t0,tf]\n- y0 = initial point\n- options(1) = N = number of step\n- options(2) = fpitermax = maximum number of iterations for the fixed point\n- options(3) = fpeps = epsilon for the test of progress in the fixed point\n\nOutput parameters\n\n- T = vector of time\n- Y = Matrix of solution, The line i of [T Y] contains ti and y(ti)\n- ifail(i) = 1 = computation successful for the fixed point on [t_i,t_{i+1}] \n- ifail(i) = -1 = computation failed for the fixed point on [t_i,t_{i+1}]: maximum number of iteration is attained in the fixed point\n- nphie = number of evaluation of phi\n\n\n\n\n\n","category":"method"},{"location":"fct_index/#EDO.ode_heun-Tuple{Function,Any,Any,Any}","page":"Index des fonctions","title":"EDO.ode_heun","text":"Heun method \n\nDescription\n\nNumerical integration of the Cauchy's problem\nx_point(t) = f(t,x(t))\nx(t_0) = x_0\n\nUsage\n\nT, X = ode_heun(f,t0tf,y0,N)\n\nInputs\n\nf    - function     : second member of the ode whith the interface \n                      xpoint = f(t, x)\n                          t    - real     : time,\n                          x = vector of R^n with the same dimension of x0\nt0tf - real(2)      : intial and final time  [t0,tf]\nx0   - real(n)      : initial point\nN    - integer      : number of steps (>1)\n\nOutputs\n\nT    - real(N+1,1)  : vector of times\nX    - real(N+1,n)  : Matrix of solution\nThe line i of [T Y] contains ti and x_i\n\n\n\n\n\n","category":"method"},{"location":"fct_index/#EDO.ode_rk41-Tuple{Function,Any,Any,Any}","page":"Index des fonctions","title":"EDO.ode_rk41","text":"Heun method \n\nDescription\n\nNumerical integration of the CauchX[i-1,:]'s problem\nx_point(t) = phi(t,x(t))\nx(t_0) = x_0\n\nUsage\n\nT, X = ode_rk4(phi,t0tf,X[i-1,:]0,N)\n\nInputs\n\nf    - function     : second member of the ode whith the interface \n                      xpoint = phi(t, x)\n                          t    - real     : time,\n                          x = vector of R^n with the same dimension of x0\nt0tf - real(2)      : intial and final time  [t0,tf]\nx0   - real(n)      : initial point\nN    - integer      : number of steps (>1)\n\nOutputs\n\nT    - real(N+1,1)  : vector of times\nX    - real(N+1,n)  : Matrix of solution, The line i of [T Y] contains ti and x_i\n\n\n\n\n\n","category":"method"},{"location":"fct_index/#EDO.ode_rk42-Tuple{Function,Any,Any,Any}","page":"Index des fonctions","title":"EDO.ode_rk42","text":"Heun method \n\nDescription\n\nNumerical integration of the CauchX[i-1,:]'s problem\nx_point(t) = phi(t,x(t))\nx(t_0) = x_0\n\nUsage\n\nT, X = ode_rk4(phi,t0tf,X[i-1,:]0,N)\n\nInputs\n\nf    - function     : second member of the ode whith the interface \n                      xpoint = phi(t, x)\n                          t    - real     : time,\n                          x = vector of R^n with the same dimension of x0\nt0tf - real(2)      : intial and final time  [t0,tf]\nx0   - real(n)      : initial point\nN    - integer      : number of steps (>1)\n\nOutputs\n\nT    - real(N+1,1)  : vector of times\nX    - real(N+1,n)  : Matrix of solution, The line i of [T Y] contains ti and x_i\n\n\n\n\n\n","category":"method"},{"location":"fct_index/#EDO.ode_runge-Tuple{Function,Any,Any,Any}","page":"Index des fonctions","title":"EDO.ode_runge","text":"runge method \n\nDescription\n\nNumerical integration of the Cauchy's problem\nx_point(t) = phi(t,x(t))\nx(t_0) = x_0\n\nUsage\n\n- T, X = ode_runge(phi,t0tf,y0,N)\n\nInputs\n\nf    - function     : second member of the ode whith the interface \n                      xpoint = phi(t, x)\n                          t    - real     : time,\n                          x = vector of R^n with the same dimension of x0\nt0tf - real(2)      : intial and final time  [t0,tf]\nx0   - real(n)      : initial point\nN    - integer      : number of steps (>1)\n\nOutputs\n\nT    - real(N+1,1)  : vector of times\nX    - real(N+1,n)  : Matrix of solution, The line i of [T Y] contains ti and x_i\n\n\n\n\n\n","category":"method"},{"location":"resultats_sujet_ordre/#Résultats-avec-Gauß","page":"Résultats TP Ordre ","title":"Résultats avec Gauß","text":"","category":"section"},{"location":"resultats_sujet_ordre/","page":"Résultats TP Ordre ","title":"Résultats TP Ordre ","text":"(Image: ) Figure 1 – Erreur globale en fonction du nombre d’évaluations. Pour Gaußen abscisse 4N afin de vérifier l’ordre. fpitermax=15, f_eps=10^-12.","category":"page"},{"location":"resultats_sujet_ordre/","page":"Résultats TP Ordre ","title":"Résultats TP Ordre ","text":"(Image: ) Figure 2 – Erreur globale en fonction du nombre d’évaluations. fpitermax=15, f_eps=10^-12.","category":"page"},{"location":"resultats_sujet_ordre/","page":"Résultats TP Ordre ","title":"Résultats TP Ordre ","text":"(Image: ) Figure 3 – Erreur globale en fonction du nombre d’évaluations. fpitermax=15, pour f_eps=10^-12 et f_eps=10^-6  et fpitemmax=2, pour f_eps=10^-14.","category":"page"},{"location":"sujet_ordre/#Sujet-TP-ordre","page":"Sujet TP ordre ","title":"Sujet TP ordre","text":"","category":"section"},{"location":"sujet_ordre/#Introduction","page":"Sujet TP ordre ","title":"Introduction","text":"","category":"section"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"Il est rappelé que les programmes doivent respecter les bonnes pratiques de la programmation. En particulier on vérifiera que les interfaces soient bien définies (paramètres en entrée, en sortie avec leurs types, les dimensions,...). Dans le cas contraire on mettra des points négatifs pour un maximum de 4 points.","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"On trouvera une version pdf de ce document à cette adresse.","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"L’objectif de ce projet est de réaliser les graphiques de la figure 1 concernant l’ordre qui seront compl ́et ́es avec les résultats obtenus pour le schéma implicite de Gauß à 2  ́etages (cf. cours sur les schémas implicites)","category":"page"},{"location":"sujet_ordre/#Rappels","page":"Sujet TP ordre ","title":"Rappels","text":"","category":"section"},{"location":"sujet_ordre/#Schémas-de-Runge-Kutta","page":"Sujet TP ordre ","title":"Schémas de Runge-Kutta","text":"","category":"section"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"On rappelle les schémas classiques","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"(Image: )","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"(Image: )","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"FIGURE 1- Erreur globale en fonction du nombre d'évaluations, E. Hairer, S.P. Nørsett and G. Wanner, Tome I, page 140, log _10(err)=C_1- p log _10(n p h i)","category":"page"},{"location":"sujet_ordre/#Travail-demandé","page":"Sujet TP ordre ","title":"Travail demandé","text":"","category":"section"},{"location":"sujet_ordre/#Ordre","page":"Sujet TP ordre ","title":"Ordre","text":"","category":"section"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"L'équation différentielle considérée est l'équation de Van der Pol","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"(I V P) leftbeginarrayldoty_1(t)=y_2(t)  doty_2(t)=left(1-y_1^2(t)right) y_2(t)-y_1(t)  y_1(0)=200861986087484313650940188  y_2(0)=0 endarrayright","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"t_f=T=6.6632868593231301896996820305 ","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"La solution de ce problème de Cauchy est périodique de période T ","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"Les programmes seront effectués en Julia. On demande que les appels aux sous-programmes se fassent ainsi :","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"Pour les schémas explicites: T,Y = ode_euler(phi, [t0 tf], y0, N) où T est un vecteur colonne de longueur N+1 et Y est de dimension (N+1, n).\nPour le schéma implicite de Gauß : T, Y, nphi, ifail = ode_gauss_fp(phi,[t0 tf], y0, options) respectivement T, Y, nphi, ifail = ode_gauss newton(phi, [t0 tf], y0, options)) pour la version point fixe (respectivement Newton) avec \noptions[1] = N\noptions[2] = nb_itmax , nombre d'itérations maximum pour le point fixe\noptions[3] = f_eps, varepsilon pour le test d'arrêt pour le point fixe\nnphi = nombre d'évaluations du second membre de l'équation différentielle\nifail[i] =nombre d'itérations si le point fixe a convergé pour l'intervalle t_i-1 t_i et -1 sinon.\nL'interface pour la fonction phi sera: ypoint = phi(t, y) ","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"Les programmes d’intégration numérique par les méthodes explicites ne devront comporter qu’une seule boucle.","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"On demande pour cette équation:","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"de réaliser les graphique de la figure 2 qui tracent les deux composantes de la solution et le plan de phase pour N=25 . Pour Gauß on prendra nb_itmax=15 et f_eps=1.e-12.","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"On fera 2 versions pour Gauß :   une version point fixe et une version Newton.","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"de réaliser les graphiques de la figure 1 Pour les schémas explicites on mettra en abscisse le vecteur (en notation Julia)  log_10([120:60:1080 1200:600:10800]). On rajoutera sur ces graphiques les résultats obtenus pour le schéma implicite de Gauß en prenant comme nombre de pas le vecteur [120:60:1080 1200:600:10800] / 4 et comme valeurs pour les paramètres nbitmax=15 et f\\eps=1.e-12\nOn fera une deuxième figure avec les résultats correspondant au schéma implicite de Gauß pour\nnb_itmax=15 et f_eps=1.e-12\nnb_itmax=2 et f_eps=1.e-12\nnb_itmax=15 et f_eps=1.e-6","category":"page"},{"location":"sujet_ordre/#Rendu","page":"Sujet TP ordre ","title":"Rendu","text":"","category":"section"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"Le travail en TP est individuel. Deux tests seront effectués, le premier lors du deuxième TP, le deuxième lors de dernière séance de TP. Le rendu définitif est à rendre le soir du dernier TP contiendra :","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"les graphiques obtenus au format pdf ; les sources des programmes qui seront mis dans un répertoire < noms >. le fichier contenant l'archive (< noms >.tar), sera envoyé à votre enseignant en TP (gergaud@enseeiht.fr ou damien.goubinat@enseeiht.fr).","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"Dans le courriel vous mentionnerez le nom du fichier Julia permettant d’obtenir les courbes résultats.","category":"page"},{"location":"sujet_ordre/#Résultats","page":"Sujet TP ordre ","title":"Résultats","text":"","category":"section"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"On trouveras aussi ci-après les figures des solutions pour N=25 pas.","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"(Image: )","category":"page"},{"location":"sujet_ordre/","page":"Sujet TP ordre ","title":"Sujet TP ordre ","text":"Figure 2- Solution de l’équation de Van der Pol, composante 1 et 2 et plan de phase, pour les schémas de Runge-Kutta avec N = 25, pour Gauß nb itmax = 15 et f_eps = 1.e-12.","category":"page"},{"location":"#Tps-Équations-différentielles-ordinaires","page":"Accueil","title":"Tps Équations différentielles ordinaires","text":"","category":"section"},{"location":"","page":"Accueil","title":"Accueil","text":"Le package EDO constitue une solution des TPs Équations différentielles ordinaires (EDO) pour l’année 2020-2021 de l'École INP-ENSEEIHT.","category":"page"},{"location":"#Auteurs-:-Joseph-GERGAUD","page":"Accueil","title":"Auteurs : Joseph GERGAUD","text":"","category":"section"},{"location":"","page":"Accueil","title":"Accueil","text":"    - Date:     december 2011\n    - Adresse:  INP-ENSEEIHT-IRIT-UMR CNRS 5055, 2 rue Camichel 31071 Toulouse FRANCE\n    - Email:    gergaud@enseeiht.fr","category":"page"}]
